import React from 'react';
import {Container, CardSet, CardSetItem, CardSetLink, Card} from './Goods.styled'

function Goods() {
  return (
    <Container>
      <CardSet>
        <CardSetItem>
          <CardSetLink href="#">
            <Card>
              {/* Вміст карточки товару */}
            </Card>
          </CardSetLink>
        </CardSetItem>
        {/* Додайте решту карточок товарів */}
      </CardSet>
    </Container>
  );
}

export default Goods;
